  false,\n\t\"url\": null,\n\t\"notes\": \"In our previous descriptions of Canada
  goose sub-populations, we have found it convenient to generalize about the \"southern
  region\"; those wintering birds predominantly associated with the states of North
  Carolina, South Carolina, Georgia, and Florida (Trost and Malecki 1985). As we begin
  to build our data base from neck collar observations we should improve our ability
  to differentiate and manage various segments of geese within this group. This report
  is an update on how things are progressing to date.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
